import "./App.css";

function App() {
  const Users = [
    { name: "pedro", age: 25 },
    { name: "Umair", age: 20 },
    { name: "James", age: 28 },
    { name: "John", age: 27 },
  ];

  return (
    <div className="App">
      {Users.map((User, key) => {
        return <Userprop name={Users.name} age={Users.age} />;
      })}
    </div>
  );
}

const Userprop = (props) => {
  return (
    <div>
      <h1>
        {props.name} {props.age}
      </h1>
    </div>
  );
};

export default App;
